import React from "react";
import "./FuncCard.css"

let FuncCard =(props) => {
    return(
        <div>
           <div className="card">
               <div className="card-body">
                   <h3>React-JS</h3>
                   <ul>
                       <li>ID: {props.employee.id}</li>
                   </ul>

               </div>
           </div>
        </div>
    );


};

export default FuncCard;
